import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import images from '../../Constants/images';
import 'bootstrap/dist/css/bootstrap.min.css';
import 'bootstrap/dist/js/bootstrap.min.js';

import './Navbar.css';

const Navbar = () => {
  const [isNavbarOpen, setIsNavbarOpen] = useState(false);

  const handleNavbarToggle = () => {
    setIsNavbarOpen(!isNavbarOpen);
  };

  const handleLinkClick = () => {
    setIsNavbarOpen(false);
  };

  return (
    <nav className='navbar navbar-expand-lg navbar-light bg-white position-sticky fixed-top'>
      <div className='container'>
        <Link className='navbar-brand' to='/'>
          <img src={images.logo} alt='logo' className='navbar-logo' />
          Care Bridge
        </Link>
        <button
          className={`navbar-toggler ${isNavbarOpen ? 'collapsed' : ''}`}
          type='button'
          data-toggle='collapse'
          data-target='#navbarNav'
          aria-controls='navbarNav'
          aria-expanded={isNavbarOpen ? 'true' : 'false'}
          aria-label='Toggle navigation'
          onClick={handleNavbarToggle}
        >
          <span className='navbar-toggler-icon'></span>
        </button>
        <div className={`collapse navbar-collapse ${isNavbarOpen ? 'show' : ''}`} id='navbarNav'>
          <ul className='navbar-nav ml-auto'>
            <li className='nav-item'>
              <Link className='nav-link' id='link-text' to='/' onClick={handleLinkClick}>
                Home
              </Link>
            </li>
            <li className='nav-item'>
              <Link className='nav-link' id='link-text' to='/about' onClick={handleLinkClick}>
                AboutUs
              </Link>
            </li>
            <li className='nav-item'>
              <Link className='nav-link' id='link-text' to='/team' onClick={handleLinkClick}>
                Doctors
              </Link>
            </li>
            <li className='nav-item'>
              <Link className='nav-link' id='link-text' to='/news' onClick={handleLinkClick}>
                News
              </Link>
            </li>
            <li className='nav-item'>
              <Link className='nav-link' id='link-text' to='/contact' onClick={handleLinkClick}>
                Contact
              </Link>
            </li>
            <li className='nav-item btn-text'>
              <Link
                className='nav-link small-appointment-btn' // Added CSS class for the button
                id='appointment-btn'
                to='/appointment'
                onClick={handleLinkClick}
              >
                Make an appointment
              </Link>
            </li>
          </ul>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
